function count(num1: string, num2: string, min_sum: number, max_sum: number): number {
    const MOD = 1e9 + 7;

    function digitSum(n: string): number {
        let sum = 0;
        for (let char of n) {
            sum += parseInt(char);
        }
        return sum;
    }

    function countGoodIntegers(start: number, end: number): number {
        let count = 0;
        for (let i = start; i <= end; i++) {
            const sum = digitSum(i.toString());
            if (sum >= min_sum && sum <= max_sum) {
                count = (count + 1) % MOD;
            }
        }
        return count;
    }

    const start = parseInt(num1);
    const end = parseInt(num2);
    return countGoodIntegers(start, end);
}
